
public class Autoboxinexp {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Integer iob,iob1;
		int i;
		iob=100;
		System.out.println("val of iob:"+iob);
		++iob;
		System.out.println("after ++iob:"+iob);
		iob1=iob+(iob/3);
		System.out.println("iob2:"+iob1);
		i=iob+(iob/3);
		System.out.println("i after exp:"+i);		
	}

}
